  function copyHTML(button)

{

  const password = button.parentNode.firstChild.textContent;

  navigator.clipboard.writeText(password).then(() => {

      button.classList.add("copied");

  });

}

  function search() {
    var searchQuery = document.getElementById("searchInput").value.toLowerCase();
    var resultsDiv = document.getElementById("results");
    
    // Wyczyść poprzednie wyniki
    resultsDiv.innerHTML = "";

    var matchingResults = data.filter(item => item.toLowerCase().includes(searchQuery));

    // Wyświetl znalezione wyniki
    if (matchingResults.length > 0) {
      matchingResults.forEach(result => {
        var resultElement = document.createElement("p");
        resultElement.innerHTML = result;
        resultsDiv.appendChild(resultElement);
      });
    } else {
      var noResultsElement = document.createElement("p");
      noResultsElement.textContent = "Brak wyników pasujących do zapytania.";
      resultsDiv.appendChild(noResultsElement);
    }
  }
